import axios from 'axios';

const DataFetch = () =>{
    const api = async() =>{
        await axios.get(`http://motherdivinefertility.in:3001/api/alldata`)
        .then((res) =>{console.log(res)})
        .catch((err) =>{console.log(err)});
    }

    return(
        <>
            <h2>Mother Divine Fertility</h2>
        </>
    )
}

export default DataFetch;
